import * as React from 'react'
import Button from '@mui/material/Button'

const QuizButton = () => {
  return (
    <Button 
      variant="contained" 
      onClick={() => window.location.href = '/quiz'}
    >
      Begin Quiz
    </Button>
  )
}

export default BeginButton
